import React from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";

// Tourist places in Uttarakhand with coordinates
const places = [
  { name: "Nainital", lat: 29.3919, lng: 79.4542 },
  { name: "Mussoorie", lat: 30.459, lng: 78.0642 },
  { name: "Rishikesh", lat: 30.0869, lng: 78.2676 },
  { name: "Haridwar", lat: 29.9457, lng: 78.1642 },
  { name: "Kedarnath", lat: 30.7352, lng: 79.0669 },
  { name: "Badrinath", lat: 30.744, lng: 79.493 },
];

const UttarakhandTour = () => {
  return (
    <div style={{ height: "500px", width: "100%", marginTop: "20px" }}>
      <MapContainer center={[30.0668, 79.0193]} zoom={8} style={{ height: "100%", width: "100%" }}>
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        />
        
        {places.map((place, index) => (
          <Marker key={index} position={[place.lat, place.lng]}>
            <Popup>{place.name}</Popup>
          </Marker>
        ))}
      </MapContainer>
    </div>
  );
};

export default UttarakhandTour;
